import React, { useState, useEffect } from "react";
import axios from 'axios';

const Log = () => {

   const [logs, setLogs] = useState({});

   useEffect(() => {
    axios.get('https://join.reckon.com/stock-pricing')
      .then(res => {
        console.log(res)
        setLogs(res.data)
      })
      .catch(err => {
        console.log(err)
      })
  },[]);

  return (
    <div>
      <ul>
        {
          [logs].map(elog => (
            <li key={elog.code}> {elog.price}</li>
          ))}
      </ul>
    </div>
  );
};

export default Log
